--Current DB: master
use master;


-- drop database grandt;
--Create database for Grand DT
create database grandt;


--Current DB: grandt
use grandt;


--Create tables for Grand DT

--Contacto
create table Contacto (
	tipo_doc char(3) not null,
	nro_doc bigint not null,
	email varchar(50) not null,
	provincia varchar(20) not null,
	partido varchar(20) not null,
	localidad varchar(20) not null,
	calle varchar(20) not null,
	numero int not null,
	piso int,
	depto char(1),
	codigo_postal varchar(10) not null,
	telefono_particular bigint not null,
	celular bigint,
	proveedor_celular varchar(30)
	);
	
-- Constraints	
alter table Contacto add primary key (tipo_doc, nro_doc);

--drop table Contacto;


-- Jugador
create table Jugador (
	--identity it's like auto_increment in mysql. Syntaxis: IDENTITY [ (seed , increment) ]
	id int not null identity(1,1),
	nombre varchar(20) not null,
	apellido varchar(20) not null,
	equipo varchar(30) not null,
	nacimiento datetime not null,
	puntaje int,
	precio money not null,
	posicion char(3) not null
	);

-- Constraints
alter table Jugador add primary key (id);

-- drop table Jugador;

-- Torneo

create table Torneo(
	id int not null identity(1,1),
	nombre varchar(40) not null
	);
	
--Constraints

alter table Torneo add primary key(id);

--drop table Torneo;


--Equipo
create table Equipo(
	id int not null identity(1,1),
	nombre varchar(30) not null,
	puntaje int
--	puntaje_acumulado int
);

-- Constraints
alter table Equipo add primary key(id);

--drop table Equipo;
	
	
--Usuario	
create table Usuario(
	tipo_doc char(3) not null,
	nro_doc bigint not null,
--	username varchar(20) not null,
	password varchar(20) not null,
	nacimiento datetime not null,
	nombre varchar(20) not null,
	apellido varchar(20) not null,
	sexo char(1) not null,
	equipo_hincha varchar(30) not null,
	monto money not null,
	monto_gastado money not null,
	equipo_fk int not null
	);

-- Constraints
alter table Usuario add primary key (tipo_doc, nro_doc);

alter table Usuario add foreign key (equipo_fk) references Equipo (id);
alter table Usuario add foreign key (tipo_doc, nro_doc) references Contacto(tipo_doc, nro_doc);
--drop table Usuario;


--EquipoJugador
create table EquipoJugador(
	equipo_fk int not null,
	jugador_fk int not null,
	--we save 1 if the player is 'titular'. Otherwise, we save 0. Boolean datatype it's not supported on MSSQLServer
	titular bit not null
	);
	
--Constraints
alter table EquipoJugador add primary key (equipo_fk, jugador_fk);

alter table EquipoJugador add foreign key (equipo_fk) references Equipo(id);
alter table EquipoJugador add foreign key (jugador_fk) references Jugador(id);
--drop table EquipoJugador


--Posiciones
create table Posiciones(
	torneo_fk int not null,
	equipo_fk int not null,
	puntaje int,
	participa bit not null
	);	
	
--Constraints
alter table Posiciones add primary key (torneo_fk, equipo_fk);

alter table Posiciones add foreign key (torneo_fk) references Torneo(id);
alter table Posiciones add foreign key (equipo_fk) references Equipo(id);

--drop table Posiciones;


